import React from "react";
import Register from "./Register";
import { Container, Col, Row } from "react-bootstrap";
import "./App.css";

const App = () => {
	return (
		<Router>
			<Switch>
				<Route exact path="/">
					<Home />
				</Route>
				{/* <Route path="/login">
					<Login />
				</Route>
				<Route path="/register">
					<Register />
				</Route> */}
				<Route exact path="/profile">
					<Profile username="Pranav" />
				</Route>
			</Switch>
		</Router>
	);
};

export default App;
